    # 校验手机号是否注册过
    @task
    def test_judge_register(self):
        try:
            self.data = self.locust.user_data_queue.get()
        except queue.Empty:
            print('test_judge_register account data run out, test ended.')
            exit(0)
        payload = {
            "account": None,
            "password": None,
            "phoneNo": self.data['phoneNo']
        }
        re = self.client.get('auth-service/user/v1',data=payload)
        re_data = re.json()
        print(re_data)
        print(self.data['phoneNo'])
        assert re_data == None
        print('判断是否注册%s'% re_data)

