    # 登录
    @task
    def test_login_app(self):
        self.millis = str(round(time() * 1000))
        headers = {
            "signTimestamp":self.millis
        }
        m = hashlib.md5()
        sha256 = hashlib.sha256()
        str1 = '123456'
        b = str1.encode(encoding='utf-8')
        m.update(b)
        str_md5 = m.hexdigest().upper()
        sha256.update((self.data['phoneNo'] + str_md5 + self.millis).encode("utf-8"))
        resu = sha256.hexdigest()
        self.secretNo = resu
        login_payload = {
            "phoneNo": self.data['phoneNo'],
            "account":None,
            "secretNo": self.secretNo
        }
        rl = self.client.post('authentication/login',headers=headers,json=login_payload)
        rl_data = rl.json()
        assert rl_data['code'] == '000000'
        print('登录%s' % rl_data)
        print(self.data['phoneNo'])
        self.token = rl_data['data']
        print('token为%s'%self.token)

